import React from 'react';

import Button from '../buttons';
import Header from '../header';
import MenuContainer from '../menuContainer';


export default class MainContainer extends React.Component {
  constructor(props) {
    super(props);

    this.state = ({
      button: [
        {label:"Back", visibility:true},
        {label:"Ordenar", visibility:true},
        {label:"Llamar mesero", visibility:true},
        {label:"Pagar", visibility:true},
        {label:"Back", visibility:true}
      ],
      page:"Inicio",
      buttonState:this.props.properties
    });
  }

  render(){
    return (
      <div className="AppFS">
        <div className="buttonDiv">
            <Button text={this.state.buttonState[1].label} css="backButton" visibility={this.state.buttonState[1].visibility}/>
            <Button text={this.state.buttonState.label} css="button" visibility={this.state.buttonState.visibility}/>
            <Button text={this.state.buttonState.label} css="button" visibility={this.state.buttonState.visibility}/>
            <Button text={this.state.buttonState.label} css="button" visibility={this.state.buttonState.visibility}/>
            <Button text={this.state.buttonState.label} css="button" visibility={this.state.buttonState.visibility}/>
        </div>
        <div className="menuDiv">
            <Header text={this.state.page}/>
            <MenuContainer page={this.state.page} css="menu-box"/>
        </div>
      </div>
    )
  }
}
